import React, { Component } from 'react';

class Chores extends Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <div className="col-2">
            <div className="tile">
              <div>Habitica</div>
              <div class="tile-icon">
                <i class="fas fa-mobile op"></i>
              </div>
              <div>Check Profile</div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Chores;
